import Vue from "vue";
import Home from "./../views/Home";
import UsersRouter from "../../routes/users.router";

Vue.use(UsersRouter);

export default new UsersRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes: [
    {
      path: "/",
      name: "home",
      component: Home,
    }
  ],
});
